const slider = document.querySelector(".slider input");
const img2 = document.querySelector(".images .img-2");
const dragLine = document.querySelector(".slider .drag-line");
slider.oninput = () => {
    let sliderValue = slider.value;
    dragLine.style.left = sliderValue + "%";
    img2.style.width = sliderValue + "%";
    if (sliderValue>80) {
        document.querySelector(".images .p-original").style.opacity = 0;
    } else {
        document.querySelector(".images .p-original").style.opacity = 1;
    }
    if (sliderValue<20) {
        document.querySelector(".images .p-gco").style.opacity = 0;
    } else {
        document.querySelector(".images .p-gco").style.opacity = 1;
    }
}

const image1 = new Image();
//image1.src = 'image1.png';
image1.src = 'data:image/jpeg;base64,';

const image2 = new Image();
image2.src = 'data:image/jpeg;base64,';


image1.addEventListener( 'load', function() {
    const canvas = document.getElementById('canvas1');
    const ctx = canvas.getContext('2d');
    canvas.width = 937;
    canvas.height = 1170;

    // To create a gradient we can use a built-in canvas method, createLinearGradient, which expect 4 arguments (two sets of coordinates). This determine the direction of the gradient (in this case from top-left corner to bottom-right corner). To change the angle of the gradient we have to change this arguments
/*     const gradient1 = ctx.createLinearGradient( 0, 0, canvas.width, canvas.height);
       const gradient1 = ctx.createLinearGradient( 0, 0, canvas.width, 0);
*/    const gradient1 = ctx.createLinearGradient( 0, 0, 0, canvas.height);
    // Then we call the addColorStop method on gradient1. It expect two argument: position between 0 and 1, color in that position. In this case we use different addColorStop to create a rainbow
    gradient1.addColorStop(0.2, 'pink');
    gradient1.addColorStop(0.3, 'red');
    gradient1.addColorStop(0.4, 'orange');
    gradient1.addColorStop(0.5, 'yellow');
    gradient1.addColorStop(0.6, 'green');
    gradient1.addColorStop(0.7, 'turquoise');
    gradient1.addColorStop(0.8, 'violet');

    const letters = ['J', 'O', 'K', 'E', 'R'];

    //* To have particles coming in waves and periodically create the splash movement
    let switcher = 1;
    let counter = 0;
    //* We create setInterval, which takes two arguments: callback funtion to run and how often in ms to run it
    setInterval(function() {
        counter++;
        //* Every 500ms counter increase by 1. Every time it's equal to a multiple of 12, switcher is set to its opposite value
        if (counter % 12 === 0) {
            switcher *= -1;
        }
    }, 500)

    ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
    console.log(pixels);

    ctx.clearRect(0, 0, canvas.width, canvas.height);

    let particlesArray = [];
    const numberOfParticles = 2000;

    //* We put the selected option value into a variable
    let gCO = 'source-over';
    let btn1 = document.getElementById('gCO-btn');

    let mappedImage = [];
    for (let y = 0; y < canvas.height; y++) {
        //* We create 1 row array for each one of the 590 rows of the image
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            //* Creiamo 1 cell array per ognuno dei 1000 pixels della riga che stiamo considerando 
            const cell = [
                cellBrightness = brightness,
                cellColor = 'rgb(' + red + ',' + green + ',' + blue + ')',
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }
    console.log(mappedImage);

    //! JS Hoisting principle: chiamiamo questa funzione prima che venga dichiarata qua sotto
    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        )/100;
    }

    // Object
    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = Math.random() * canvas.height;
            this.speed = 0;
            this.velocity = Math.random() * 2 + 1;
            this.size = Math.random() * 2.5;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            //* We give different angle to each particle so that each particle fluctuate at different speed depending on the brightness of the underlying area
            this.angle = Math.random() * 2 + 0.5;
            //* We randomly assign a letter to the particle
            //! this.letter = letters[Math.floor(Math.random() * letters.length)];
            //* To have only a certain % of particles to be letters and the rest regular circles
            this.random = Math.random();
        }
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            //* Con this.angle potrebbero verificarsi errori a causa di particles che fuoriescono dalla canvas area (risultano undefined) e per le quali non è quindi possibile accedere a this.speed. Per cui aggiungiamo un if per verificare che position y e position x non siano undefined:
            if ((this.speed = mappedImage[this.position1])&&(mappedImage[this.position1][this.position2])) {
                this.speed = mappedImage[this.position1][this.position2][0];
            }
            let movement = (2.5 - this.speed) + this.velocity;
            this.angle += this.speed/12;
            //* We can make size of particles smaller in dark areas and larger in bright areas
            this.size = this.speed * 2;

            // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/globalCompositeOperation
            //* soft-light effects how light and dark is displayed
            //! ctx.globalCompositeOperation = 'soft-light';
            //* luminosity preserves luma/brightness of the top layer and hue and chroma of the bottom layer
            //! ctx.globalCompositeOperation = 'luminosity';
            //! ctx.globalCompositeOperation = 'lighter';

            btn1.onclick = () => {
                counter = 0; 
                gCO = document.getElementById('globalCompositeOperation').value;
            };

            /* if (switcher === 1) {
                ctx.globalCompositeOperation = gCO;
            } else {
                ctx.globalCompositeOperation = 'source-over';
            }*/
            if (counter % 12 === 0) {
                this.x = Math.random() * canvas.width;
                this.y = 0;
            }  

            //! Top to bottom
            /* this.y += movement;
            this.x += 0;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
            if (this.x >= canvas.height) {
                this.x = 0;
                this.y = Math.random() * canvas.height;
            } */
            //! Left to right
           /*  this.y += 0;
            this.x += movement;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
            if (this.x >= canvas.height) {
                this.x = 0;
                this.y = Math.random() * canvas.height;
            } */
            //! 45deg
            this.y += movement + Math.sin(this.angle) * 2;
            this.x += movement + Math.cos(this.angle) * 2;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
            if (this.x >= canvas.width) {
                this.x = 0;
                this.y = Math.random() * canvas.height;
            }
        }
        draw(){
            ctx.beginPath();
            //* Stesso possibile errore di this.speed per particles che risultano undefined perchè fuori dalla canvas area, per le quali quindi non è definito il colore. Aggiungiamo lo stesso if:
            if ((this.speed = mappedImage[this.position1])&&(mappedImage[this.position1][this.position2])) {
                ctx.fillStyle = mappedImage[this.position1][this.position2][1];
                ctx.strokeStyle = mappedImage[this.position1][this.position2][1];
            }
            //* To apply the rainbow-gradient we disable the original color and set fillStyle to gradient1
            //! ctx.fillStyle = gradient1;
            //! ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            //* Instead of cirlce, we can use stroke rectangles. We add the stroke style up in the if, otherwise it will be all black
            //! ctx.strokeRect(this.x, this.y, this.size*2, this.size*2);
            //* Or we can use letters. This is a little more demanding on performance
            //! Around line 25 we created: const letters = ['J', 'O', 'K', 'E', 'R'];
            //* We can use ctx.font to set a size and a form family
            ctx.font = '10px Arial';
            //* We select a random letter of the letters array
            let letter = letters[Math.floor(Math.random()*letters.length)];
            //! ctx.fillText(this.letter, this.x, this.y);
            //* This way the letter don't remain the same, but change every update
            ctx.fillText(letter, this.x, this.y);
            //* Letter or circle/rect
            /* if (this.random < 0.2) {
                ctx.fillText(this.letter, this.x, this.y);
            } else {
                //! ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
                ctx.strokeRect(this.x, this.y, this.size*2, this.size*2);
            } */
           

            ctx.fill();
        }
    }
    function init() { 
        for(let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle);
        }
        console.log(particlesArray);
    }
    init();

    function animate() {
        /* ctx.drawImage(image1, 0, 0, canvas.width, canvas.height); */
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0, 0, 0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.2;
        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            //* Full opacity
            ctx.globalAlpha = 1;
            //* Opacity bases on the movement speed of the particle
            //! ctx.globalAlpha = particlesArray[i].speed * 0.5;
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();

});

